INSERT INTO `answer` (`id`, `text`, `weight`, `question`) VALUES
(381, 'Не понимает и не анализирует стратегию ни своей работы, ни организации в целом.', 1, 96),
(382, 'Знает стратегические цели, глубоко понимает, каким образом они определяют цели его бизнес-единицы (подразделения). Строит долгосрочные успешные прогнозы. Разрабатывает мероприятия в рамках основной стратегической линии компании. Регулярно доводит основы стратегии до подчиненных. Увязывает стратегические планы компании с актуальными задачами подразделения. Смотрит на развитие подразделения, бизнес-единицы «с высоты вертолета». Учитывает последствия и открывающиеся возможности при принятии решений.', 4, 96),
(383, 'В целом, понимает и анализирует стратегию организации. Принимает текущие решения с учетом стратегических целей. Может оценить внешние и внутренние факторы, которые влияют на производительность организации и ее результаты. Строит успешные средне- и краткосрочные прогнозы. Не всегда способен на четкое видение долгосрочной перспективы развития. Доводит стратегические цели компании до своих подчиненных. Разъясняет значимость учета этих целей в текущей деятельности подразделения.', 3, 96),
(384, 'Демонстрирует понимание того, как деятельность его отдела / подчиненных связана с деятельностью организации в целом. Не всегда связывает стратегические  цели с повседневными задачами своего подразделения. Затрудняется строить долгосрочные успешные прогнозы. Допускает ошибки при просчете последствий принимаемых решений. Не регулярно транслирует стратегические планы компании и их связь с текущими задачами своим подчиненным.', 2, 96),
(389, 'Ориентируется в разнообразной информации, умеет выделять из нее нужную для решения своих задач. Регулярно собирает и структурирует всю необходимую для анализа информацию. Анализирует информацию, делает логически обоснованные выводы. Ответственность за решение и его исполнение развита в достаточной мере. Чаще всего хватает ответственности за принятые решения.', 3, 98),
(390, 'Информацию для анализа собирает эпизодически, может не знать, по каким признакам ее структурировал. Ориентируется на ресурсы, которых, порой, недостаточно для принятия решения. Не достаточно хорошо устанавливает логические связи, плохо видит зависимости. Факторы, создающие проблему, часто выделяются ошибочно. Ответственность за решение и его исполнение развита в недостаточной мере. Пытается принимать самостоятельные решения, но всегда обращается за их одобрением к руководителю или коллегам.', 2, 98),
(391, 'Очень хорошо ориентируется в больших объемах информации. Умеет выделять главное. Использует разнообразные источники информации. Систематически собирает и безошибочно структурирует всю необходимую для анализа информацию. При исследовании полученной информации выявляет,  взвешивает риски, умеет назначить «вес» каждому варианту и выбрать лучший вариант достижения нужных результатов. Всегда самостоятельно принимает решения и ответственность за их исполнение и последствия. Не нуждается в одобрении и «подбадривании» руководителя и коллег.', 4, 98),
(392, 'Информация собирается хаотично, не подвергается структурированию. Не умеет анализировать собранный данные. Не видит основные факторы, создающие проблему, (не видит систему за частностями). Решения часто основываются на непроверенной информации или на эмоциях. Ответственность за решение и его исполнение практически отсутствует. Всегда избегает принимать единоличные решения, боится взять на себя ответственность.', 1, 98),
(397, 'Испытывает сложности с одним или несколькими процессами: системой планирования/постановки задач/делегирования/контроля/обучения и т.д.', 2, 97),
(398, 'Отсутствует способность управлять подчиненными в рамках основных управленческих компетенций: планирования/ постановки задач/ и т.д.', 1, 97),
(399, 'Присутствует несколько компетенций из указанных: Знает и учитывает потребности, сильные и слабые стороны сотрудников и учитывает их при выборе способа работы с ними и их развития. Всегда четко ставит и разъясняет задачи, правильно распределяет подчиненных с учетом их характера и объема работ,  в соответствии с их способностями и интересами. Всегда эффективно организует выполнение поставленных задач, обеспечивая взаимозаменяемость подчиненных. Контролирует выполнение работ, используя промежуточные точки контроля, выясняет причины ошибок и помогает их исправлять. Вдохновляет подчиненных, создает у них ощущение силы решать все возникающие задачи. Применяет эффективные системы мотивации персонала, наделения их полномочиями. Создает эффективную команду. Выделяет и развивает кадровый резерв.', 3, 97),
(400, 'Присутствует большинство компетенций из указанных: Знает и учитывает потребности, сильные и слабые стороны сотрудников и учитывает их при выборе способа работы с ними и их развития. Всегда четко ставит и разъясняет задачи, правильно распределяет подчиненных с учетом их характера и объема работ,  в соответствии с их способностями и интересами. Всегда эффективно организует выполнение поставленных задач, обеспечивая взаимозаменяемость подчиненных. Контролирует выполнение работ, используя промежуточные точки контроля, выясняет причины ошибок и помогает их исправлять. Вдохновляет подчиненных, создает у них ощущение силы решать все возникающие задачи. Применяет эффективные системы мотивации персонала, наделения их полномочиями. Создает эффективную команду. Выделяет и развивает кадровый резерв.', 4, 97),
(401, 'Достигает результатов деятельности, опираясь на ключевые составляющие организации процесса: Предварительно планирует; Разделяет большие задачи на удобные для контроля элементы; Выявляет приоритетные задачи; Запасается необходимыми ресурсами (материальными, временными  и др.); Прогнозирует возможные временные накладки из-за непредвиденных обстоятельств; Осуществляет мониторинг хода выполнения задачи; Вносит необходимые корректировки.', 3, 99),
(402, 'Достигает результатов деятельности, но не всегда должного качества или в заданные сроки. В организации процесса своей деятельности пропускает некоторые важные моменты, связанные с грамотным планированием,  обеспечением ресурсами, расстановкой приоритетов, распределением времени. Сам процесс деятельности складывается, подчас хаотично, неконтролируемо, по принципу «затыкания дыр». Различные составляющие процесса деятельности могут протекать разнонаправленно, со сбоями, и не  реагировать на применяемые к ним корректирующие мероприятия.', 2, 99),
(403, 'Всегда достигает  результатов деятельности, опираясь на выстроенную эффективную систему организации процесса: Осуществляет планирование (стратегическое, детальное). Анализирует сложные задачи и разделяет их на управляемые элементы. Быстро и точно определяет и расставляет приоритеты, даже при наличии противоречивых планов и большого количества различных задач. Под каждый этап процесса распределяет необходимые ресурсы (материальные, временные и др.). Закладывает резерв времени на непредвиденные обстоятельства. Владеет методами промежуточного и окончательного контроля процесса. Гибко реагирует на происходящие в процессе работы изменения. Своевременно вносит коррективы.', 4, 99),
(404, 'Организация процесса частично или полностью пущена на самотек. Сотрудник не способен организовать  процессы трудовой деятельности  на должном уровне.', 1, 99),
(405, 'Знает ключевые показатели эффективности своего подразделения. Понимает взаимосвязь между показателями и методологию их расчёта. Может спрогнозировать влияние своих решений на конкретный показатель. Как правило, применяет эти показатели при принятии практических решений. Стремится к извлечению экономической выгоды в работе подразделения. Знает рынок. Использует эту информацию для выявления возможностей для развития компании, предлагает различные варианты дополнительного зарабатывания, но не всегда учитывает интересы компании для установления долгосрочных отношений. В большинстве случаев, находит пути для наиболее полного оптимального использования имеющихся ресурсов (технических, энергетических, временных, человеческих, финансовых и т.п.). Предпринимает усилия по оптимизации издержек на вверенном участке работы. Старается внедрять мероприятия по снижению неэффективных расходов.', 3, 100),
(406, 'Отсутствуют знания ключевых показателей эффективности своего подразделения. Нет ориентации на повышение экономической эффективности вверенного участка работы. Хозяйственный подход – отсутствует. Имеющиеся ресурсы используются не оптимально. Не заинтересован в поиске путей развития подразделения, компании. Нацелен на оказание услуг основному заказчику любой ценой, не принимая во внимание интересы компании. Не владеет и не интересуется составом своих расходов. Не владеет навыками оптимизации издержек.', 1, 100),
(407, 'Знания ключевых показателей эффективности своего подразделения довольно ограниченные. Имеет общее представление о взаимосвязи между показателями. Частично понимает методологию их расчёта. Способность применять экономические знания на практике выражена в недостаточной степени. Слабо учитывает коммерческие интересы, финансовую целесообразность. Ориентируется сугубо в рамках имеющихся возможностей использования ресурсов (технических, энергетических, временных, человеческих, финансовых и т.п.). Практически не интересуется положением компании на рынке, не видит возможностей для роста и развития. Предпринимаемые меры по оптимизации издержек своего участка работы – недостаточны.', 2, 100),
(408, 'Отлично знает и применяет на практике ключевые показатели эффективности своего подразделения. С достаточной достоверностью прогнозирует изменение ключевых показателей от принятых решений. Умеет выбирать из множества решений наиболее выгодное для компании. Выстраивает свою деятельность с учетом экономической выгоды. Использует информацию о рынке, конкурентах, клиентах для поиска возможностей роста и развития подразделения и компании. Находит пути увеличения прибыли своего подразделения на долгосрочную перспективу. Выходит с предложениями по оптимизации деятельности подразделения. Добивается конкретного РЕЗУЛЬТАТА по итогам внедрения оптимизационных мер. Осуществляет хозяйственный подход, предпринимает все необходимые усилия по оптимальному  использованию имеющихся ресурсов (технических, энергетических, временных, человеческих, финансовых и т.п.).', 4, 100),
(409, 'Для донесения своей точки зрения довольно успешно может пользоваться различными каналами коммуникаций. В общении стремится к достижению понимания, и, как правило, успешно. Излагает свои мысли в целом связно и логично как в развернутой форме (доклад, выступление), так и сжатой (отчет, ответ). Как правило, выстраивает коммуникации, учитывая интересы обеих сторон. Использует эмоции для повышения эффективности мышления и своей деятельности. Всегда стремится понять эмоции других людей и адекватно отреагировать на них. Демонстрирует уверенное поведение в большинстве ситуаций, умеет владеть своим эмоциональным состоянием в ситуациях переговоров. Может отстаивать свои взгляды и мнения, обосновывать принятые решения. Не боится публичных выступлений, речь выразительна, управляет своим голосом.', 3, 101),
(410, 'Не способен ясно и точно выражать свои мысли. Не слушает других и не стремится к пониманию другой стороной общения. Допускает большое количество ошибок в письменной и/или устной речи. В речи могут присутствовать  слова-паразиты, усложняющие восприятие речи. Не способен (или не считает нужным) управлять своим эмоциональным состоянием, не понимает и не анализирует эмоции в коммуникациях. Не проявляет открытость в межличностных отношениях. Не владеет навыками убеждения, либо излишне «давит» на партнера, либо занимает соглашательскую позицию. Полагает, что правильные мнения в доказательстве не нуждаются. Не обладает выразительностью речи, испытывает дискомфорт при необходимости вступать в коммуникации, избегает публичных выступлений.', 1, 101),
(411, 'Очень хорошо излагает свои мысли, как устно, так и письменно. Логично и аргументировано убеждает в своей правоте с учетом интересов всех сторон. При общении с людьми любого уровня говорит на доступном собеседнику языке, способен «подстроиться» под стиль общения любого партнера. Чувствителен к эмоциональным сигналам  другого человека, реагирует  на них, повышая качество коммуникаций. Стабильно высокий уровень контроля над своим эмоциональным состоянием. Без труда добивается поддержки сотрудников в отношении своих взглядов и позиций. Легко поддерживает атмосферу доверия и взаимной выгоды. Уверенно держится перед публикой, легко управляет своим голосом , обладает эмоционально окрашенной речью.', 4, 101),
(412, 'Испытывает затруднения при использовании одного или обоих (устного и письменного) канала обмена информацией. Не всегда ясно излагает свои мысли: склонен к витиеватости/многословности или наоборот, слишком краток, что не позволяет собеседнику понять о чем он говорит/пишет. Общение требует уточнений со стороны собеседника. Возможен другой вариант: при достаточно хорошем умении формулировать свои мысли разными способами, склонен занимать такую позицию в отношении собеседника, когда он действует только исходя из личных  интересов, без  учета интересов партнера или организации в целом. Редко получается сознательно управлять своим эмоциональным состоянием. Возникают сложности  при понимании и анализе эмоций в межличностном взаимодействии. Может пропагандировать и отстаивать принятые решения, но делает это не всегда, не уверенно и неубедительно. Способен выступать перед публикой, однако испытывает большое психологическое напряжение, не может удержать внимание аудитории.', 2, 101),
(413, 'Подход к решению задач достаточно стандартный, редко использует новые  способы и инструменты в работе.', 2, 102),
(414, 'Скептически относится к нововведениям, мышление в основном шаблонное, применяет только проверенные способы решения задач.', 1, 102),
(415, 'В решении рабочих задач может применять новые, наиболее оптимальные способы решения, стремится разнообразить подходы к постоянным, рутинным процессам.', 3, 102),
(416, 'Всегда отличается нестандартным мышлением. Быстро и эффективно находит новые способы решения стоящих задач. С интересом и готовностью участвует в новых проектах. Генерирует новые идеи. Разрабатывает, внедряет, усовершенствует инновационные продукты, методы, подходы, процессы и т.п.', 4, 102),
(417, 'Постоянно проявляет стремление к улучшению любых востребованных областей своей деятельности. При чем, делает это самостоятельно, без давления извне или просьб. Всегда идет «на шаг впереди», предлагает новые, конструктивные идеи, способные вывести свое подразделение и компанию  в целом далеко вперед. Инициативен в высокой степени.', 4, 103),
(418, 'Всегда находится в активной позиции по отношению к решению всех задач, участия в проектах. Предлагает идеи. С готовностью и одобрением относится к нововведениям. Периодически выходит за рамки своих обязанностей, если видит возможности, которые могут быть полезны ему и команде.', 3, 103),
(419, 'Испытывает затруднения при необходимости проявить активность/ разработать и внедрить нововведение: Демонстрирует, скорее, реактивное поведение : «Будет задача, будем ее решать, а пока работаем как работали».', 1, 103),
(420, 'Не достаточно активен. Редко проявляет инициативу в рабочих вопросах, чаще готов выполнять уже готовые решения. Может проявлять  желание улучшать существующие процессы,  но ограничивается рамками своей деятельности, не особо интересуясь положением дел смежных подразделений, компании в целом.', 2, 103),
(421, 'Профессиональные знания поверхностные. Не имеет достаточных навыков работы по профессии. Допускает значительные сбои в рабочих процессах. Не ориентирован на получение знаний и применение их на практике.', 1, 104),
(422, 'Профессиональные знания достаточно общие. Отсутствует глубокое представление обо всех нюансах работы по профессии. Допускает сбои в стандартных рабочих процессах, влияющие на  качество, количество и (или) сроки предоставления  результатов труда. Не видит необходимости повышать свой профессиональный уровень ни теоритически, ни практически. Однако, может соглашаться на обучение по требованию руководства.', 2, 104),
(423, 'Обладает уникальным опытом и знаниями, позволяющими легко разбираться в комплексных профессиональных вопросах. Обладает свойством систематически, эффективно и надежно выполнять сложную деятельность в самых разнообразных условиях. Разбирается в нестандартных рабочих ситуациях. Понимает все тонкости и нюансы профессии. Ценен для компании как носитель уникальных технологий и бизнес-процессов. Эксперт, «Мастер своего дела». Постоянно совершенствует свой профессиональный уровень, стремится подняться на высшую ступеньку мастерства в своем роде занятий.', 4, 104),
(424, 'Хорошие профессиональные знания. Обладает опытом, сформировавшим  необходимые и достаточные  умения и навыки по профессии. Достигает целей в заданные сроки, сохраняя достойное качество работы. В нестандартных и сложных рабочих ситуациях возможно некоторое снижение эффективности. Достаточное понимание всех направлений деятельности, отраслевой специфики. Повышает свою квалификацию в необходимых для компании требованиях.', 3, 104),
(425, 'Не отказывает, но и не стремится проявлять инициативу в обучении других сотрудников. Откликается только на конкретные просьбы о помощи, если они не сильно отвлекают его от своей деятельности. Не всегда доходчиво и понятно может объяснить, научить, показать на собственном примере решение требуемой проблемы. Не дает обратную связь о продвижении сотрудника в рабочем процессе.', 2, 105),
(426, 'Не способен обучать и развивать сотрудников. Не имеет желания прикладывать усилия для повышения мастерства других людей. Скорее откажет в просьбе о помощи в разрешении чьей-нибудь рабочей проблемы.', 1, 105),
(427, 'Обладает отличным умением и большим желанием передавать накопленные знания и опыт своим коллегам и подчиненным. Систематически консультирует, обучает, развивает сотрудников. Сам является примером высокого профессионализма, авторитетен в глазах сотрудников. Знает все тонкости и нюансы работы, может продемонстрировать или объяснить эффективные способы их выполнения. Дает конкретную обратную связь другим относительно их сильных и слабых сторон, формируя в них компетентность и ответственность. В обучении проявляет позитивный эмоциональный настрой, поддерживает «учеников». Умеет доносить до других цели организации, следит за тем, чтобы люди в его подразделении  понимали связь своей работы с общими задачами всей компании. Понимает необходимость развития кадрового резерва на предприятии.', 4, 105),
(428, 'Умеет и проявляет инициативу в обучении и развитии сотрудников компании. Не ждет, пока его попросят разъяснить те или иные рабочие вопросы, в которых он разбирается лучше других. Доходчиво объясняет необходимые проблемные моменты. Затрачивает усилия по обучению только на тех сотрудников, в которых видит перспективу или которые проявляют большой интерес к его знаниям и опыту. В моменты затруднений у сотрудника дает обратную связь, которая  стимулирует его развитие. Умеет мотивировать сотрудников на повышение их профессионального уровня. Иногда, может выйти на более высокий уровень и обсудить  с сотрудниками значимость выполняемой работы, необходимость повышения мастерства в рамках не только своей должности, но и подразделения и компании в целом.', 3, 105),
(429, 'Не понимает значимости взаимовыгодного сотрудничества и крепких партнерских отношений с внешними и внутренними  клиентами для стабильной и долгой работы компании. Отсутствует способность выстраивать эффективные отношения с клиентами. При возникновении проблем с клиентами/партнерами/коллегами предпочитает переложить ответственность на другую  конфликтующую сторону. Не отдает отчет в том, что любые (даже самые незначительные)  жалобы клиентов могут перерасти в большие проблемы для компании, серьезно сказаться на ее имидже и положении на рынке.', 1, 106),
(430, 'Умеет распознавать потребности клиентов/партнеров/коллег. Во взаимодействии старается соблюдать баланс интересов своих и второй стороны. Настроен на поиск оптимальных для всех решений. Оперативно решет возникающие конфликтные ситуации, принимает меры к предотвращению возможных проблем в будущем. В большинстве случаев понимает и удовлетворяет не только явные, но и скрытые, не озвученные проблемы клиентов. Своевременно поздравляет клиентов с основными государственными, профессиональными праздниками.', 3, 106),
(431, 'Не достаточно хорошо понимает значимость удовлетворения клиентов – как основного приоритета в работе компании. Не знаком со своими клиентами так, чтобы понимать все их потребности. Во взаимодействии с клиентами/коллегами чаще отстаивает только свои интересы. Понимает только явные, озвучиваемые потребности, не распознает скрытых потребностей. Не предпринимает необходимых усилий к сглаживанию возникших или предупреждению возможных конфликтных ситуаций. Откликается только на самые серьезные критические обращения, затягивает решения проблем до последнего момента.', 2, 106),
(432, 'Обладает глубокими знаниями и отличным пониманием клиентов,  их поведения и потребностей. Умеет смотреть на результаты своей работы  и работы компании глазами клиента (партнера). Принимает на себя личную ответственность за качественное обслуживание клиентов. Выявляет интересы и потребности коллег и клиентов с целью их удовлетворения, помогает им сформулировать и структурировать запрос. Способен устанавливать и поддерживать долгосрочные и эффективные отношения. Всегда открыт для их обращений, проявляет инициативу в решении любых возникающих, даже не по вине компании, проблем. Знает и поздравляет своих основных клиентов с из личными праздниками (Дни рождения и т.п.).', 4, 106),
(433, 'Безусловно понимает и принимает компанию. Точно знает и разделяет ценности, цели, правила компании (даже неформальные). Выстраивает свое рабочее поведение в соответствии с ними. Является приверженцем компании. Неравнодушен ко всему, что связано с ней. Находит собственные цели и ценности схожими с целями и ценностями  компании. Связывает свое будущее с компанией. Прикладывает гораздо больше усилий, чем прописано в должностной инструкции. Проявляет преданность своему делу, своей работе. Проявляет желание улучшить компанию. Испытывает чувство гордости за место, в котором работает. Интересы предприятия всегда на первом месте. ', 4, 107),
(434, 'Ценности компании в общем понимает, но к себе не применяет, предпочитая оставаться в стороне. Работает только на осуществление своей функции, не соотнося ее с общим результатом. Некоторые принципы, правила и нормы компании вызывают отторжение. В разговоре о компании может фокусироваться на негативных сторонах, оставляя в стороне положительные моменты. Не готов связывать себя с компанией в долгосрочной перспективе.', 2, 107),
(435, 'Понимает и принимает ценности и цели  компании. При необходимости готов к выполнению сверх необходимого. Принимает активное участие в жизни компании. Проявляет неравнодушное отношение не только к проблемам, касающимся лично себя, но и своего подразделения,  компании. Планирует работать в компании в будущем. Положительно отзывается о компании, о работе и взаимоотношениях в ней.', 3, 107),
(436, 'Ценности компании не разделяет. Не отождествляет себя с компанией. Прослеживается негативное отношение к Работодателю. Выстраивает свое поведение в разрез с правилами и нормами, принятыми в компании. Не уверен, что будет работать в компании продолжительный период.', 1, 107),
(449, 'Достигает результатов деятельности, но не всегда должного качества или в заданные сроки. В организации процесса своей деятельности пропускает некоторые важные моменты, связанные с грамотным планированием,  обеспечением ресурсами, расстановкой приоритетов, распределением времени. Сам процесс деятельности складывается, подчас хаотично, неконтролируемо, по принципу «затыкания дыр». Различные составляющие процесса деятельности могут протекать разнонаправленно, со сбоями, и не  реагировать на применяемые к ним корректирующие мероприятия.', 2, 125),
(450, 'Достигает результатов деятельности, опираясь на ключевые составляющие организации процесса: Предварительно планирует. Разделяет большие задачи на удобные для контроля элементы. Выявляет приоритетные задачи. Запасается необходимыми ресурсами (материальными, временными  и др.). Прогнозирует возможные временные накладки из-за непредвиденных обстоятельств. Осуществляет мониторинг хода выполнения задачи. Вносит необходимые корректировки.', 3, 125),
(451, 'Всегда достигает результатов деятельности, опираясь на выстроенную эффективную систему организации процесса: Осуществляет планирование (стратегическое, детальное). Анализирует сложные задачи и разделяет их на управляемые элементы. Быстро и точно определяет и расставляет приоритеты, даже при наличии противоречивых планов и большого количества различных задач. Под каждый этап процесса распределяет необходимые ресурсы (материальные, временные и др.). Закладывает резерв времени на непредвиденные обстоятельства. Владеет методами промежуточного и окончательного контроля процесса. Гибко реагирует на происходящие в процессе работы изменения. Своевременно вносит коррективы.', 4, 125),
(452, 'Организация процесса частично или полностью пущена на самотек. Сотрудник не способен организовать  процессы трудовой деятельности  на должном уровне.', 1, 125),
(453, 'Умеет формулировать цели и разбивать их на последовательные шаги. Старается преодолевать препятствия в достижении целей. В большинстве случаев приходит к нужному результату.', 3, 126),
(454, 'Ориентация на результат отсутствует. Работает только на процесс. Живет \"сегодняшним днем\". Цели не определены.', 1, 126),
(455, 'В основном работает на процесс. Сложно поставить четкие цели и определить шаги к их достижению. Избегает ответственности за результат. Нужный результат достигается редко.', 2, 126),
(456, 'Высокий уровень целеполагания. Конечный результат всегда четко определен во времени и критериях. Издержки процесса никогда не мешают достигать поставленных целей. Достигает целей в заданные сроки, сохраняя высокое качество работы. Обладает самомотивацией  на достижение результата.', 4, 126),
(457, 'Информация собирается хаотично, не подвергается структурированию. Не умеет анализировать собранный данные. Не видит основные факторы, создающие проблему, (не видит систему за частностями). Решения часто основываются на непроверенной информации или на эмоциях. Ответственность за решение и его исполнение практически отсутствует. Всегда избегает принимать единоличные решения, боится взять на себя ответственность.', 1, 127),
(458, 'Очень хорошо ориентируется в больших объемах информации. Умеет выделять главное. Использует разнообразные источники информации. Систематически собирает и безошибочно структурирует всю необходимую для анализа информацию. При исследовании полученной информации выявляет,  взвешивает риски, умеет назначить «вес» каждому варианту и выбрать лучший вариант достижения нужных результатов. Всегда самостоятельно принимает решения и ответственность за их исполнение и последствия. Не нуждается в одобрении и «подбадривании» руководителя и коллег.', 4, 127),
(459, 'Ориентируется в разнообразной информации, умеет выделять из нее нужную для решения своих задач. Регулярно собирает и структурирует всю необходимую для анализа информацию. Анализирует информацию, делает логически обоснованные выводы. Ответственность за решение и его исполнение развита в достаточной мере. Чаще всего хватает ответственности за принятые решения.', 3, 127),
(460, 'Информацию для анализа собирает эпизодически, может не знать, по каким признакам ее структурировал. Ориентируется на ресурсы, которых, порой, недостаточно для принятия решения. Не достаточно хорошо устанавливает логические связи, плохо видит зависимости. Факторы, создающие проблему, часто выделяются ошибочно. Ответственность за решение и его исполнение развита в недостаточной  мере.  Пытается принимать самостоятельные решения, но всегда обращается за их одобрением к руководителю или коллегам.', 2, 127),
(461, 'Отсутствуют знания ключевых показателей эффективности своего подразделения. Нет ориентации на повышение экономической эффективности вверенного участка работы. Хозяйственный подход – отсутствует. Имеющиеся ресурсы используются не оптимально. Не заинтересован в поиске путей развития подразделения, компании. Нацелен на оказание услуг основному заказчику любой ценой, не принимая во внимание интересы компании. Не владеет и не интересуется составом своих расходов. Не владеет навыками оптимизации издержек.', 1, 128),
(462, 'Знает ключевые показатели эффективности своего подразделения. Понимает взаимосвязь между показателями и методологию их расчёта. Может спрогнозировать влияние своих решений на конкретный показатель. Как правило, применяет эти показатели при принятии практических решений. Стремится к извлечению экономической выгоды в работе подразделения. Знает рынок. Использует эту информацию для выявления возможностей для развития компании, предлагает различные варианты дополнительного зарабатывания, но не всегда учитывает интересы компании для установления долгосрочных отношений. В большинстве случаев, находит пути для наиболее полного оптимального использования имеющихся ресурсов (технических, энергетических, временных, человеческих, финансовых и т.п.). Предпринимает усилия по оптимизации издержек на вверенном участке работы. Старается внедрять мероприятия по снижению неэффективных расходов.', 3, 128),
(463, 'Знания ключевых показателей эффективности своего подразделения довольно ограниченные. Имеет общее представление о взаимосвязи между показателями. Частично понимает методологию их расчёта. Способность применять экономические знания на практике выражена в недостаточной степени. Слабо учитывает коммерческие интересы, финансовую целесообразность. Ориентируется сугубо в рамках имеющихся возможностей использования ресурсов (технических, энергетических, временных, человеческих, финансовых и т.п.). Практически не интересуется положением компании на рынке, не видит возможностей для роста и развития. Предпринимаемые меры по оптимизации издержек своего участка работы – недостаточны.', 2, 128),
(464, 'Отлично знает и применяет на практике ключевые показатели эффективности своего подразделения. С достаточной достоверностью прогнозирует изменение ключевых показателей от принятых решений. Умеет выбирать из множества решений наиболее выгодное для компании. Выстраивает свою деятельность с учетом экономической выгоды. Использует информацию о рынке, конкурентах, клиентах для поиска возможностей роста и развития подразделения и компании. Находит пути увеличения прибыли своего подразделения на долгосрочную перспективу. Выходит с предложениями по оптимизации деятельности подразделения. Добивается конкретного РЕЗУЛЬТАТА по итогам внедрения оптимизационных мер. Осуществляет хозяйственный подход, предпринимает все необходимые усилия по оптимальному  использованию имеющихся ресурсов (технических, энергетических, временных, человеческих, финансовых и т.п.).', 4, 128),
(465, 'Для донесения своей точки зрения довольно успешно может пользоваться различными каналами коммуникаций. В общении стремится к достижению понимания, и, как правило, успешно. Излагает свои мысли в целом связно и логично как в развернутой форме (доклад, выступление), так и сжатой (отчет, ответ). Как правило, выстраивает коммуникации, учитывая интересы обеих сторон. Использует эмоции для повышения эффективности мышления и своей деятельности. Всегда стремится понять эмоции других людей и адекватно отреагировать на них. Демонстрирует уверенное поведение в большинстве ситуаций, умеет владеть своим эмоциональным состоянием в ситуациях переговоров. Может отстаивать свои взгляды и мнения, обосновывать принятые решения. Не боится публичных выступлений, речь выразительна, управляет своим голосом.', 3, 129),
(466, 'Испытывает затруднения при использовании одного или обоих (устного и письменного) канала обмена информацией. Не всегда ясно излагает свои мысли: склонен к витиеватости/многословности или наоборот, слишком краток, что не позволяет собеседнику понять о чем он говорит/пишет. Общение требует уточнений со стороны собеседника. Возможен другой вариант: при достаточно хорошем умении формулировать свои мысли разными способами, склонен занимать такую позицию в отношении собеседника, когда он действует только исходя из личных  интересов, без  учета интересов партнера или организации в целом. Редко получается сознательно управлять своим эмоциональным состоянием. Возникают сложности  при понимании и анализе эмоций в межличностном взаимодействии. Может пропагандировать и отстаивать принятые решения, но делает это не всегда, не уверенно и неубедительно. Способен выступать перед публикой, однако испытывает большое психологическое напряжение, не может удержать внимание аудитории.', 2, 129),
(467, 'Очень хорошо излагает свои мысли, как устно, так и письменно. Логично и аргументировано убеждает в своей правоте с учетом интересов всех сторон. При общении с людьми любого уровня  говорит на доступном собеседнику языке, способен «подстроиться» под стиль общения любого партнера.  Чувствителен к эмоциональным сигналам  другого человека, реагирует  на них, повышая качество коммуникаций. Стабильно высокий уровень контроля над своим эмоциональным состоянием. Без труда добивается поддержки сотрудников в отношении своих взглядов и позиций. Легко поддерживает атмосферу доверия и взаимной выгоды. Уверенно держится перед публикой, легко управляет своим голосом, обладает эмоционально окрашенной речью.', 4, 129),
(468, 'Не способен ясно и точно выражать свои мысли. Не слушает других и не стремится к пониманию другой стороной общения. Допускает большое количество ошибок в письменной и/или устной речи. В речи могут присутствовать  слова-паразиты, усложняющие восприятие речи. Не способен (или не считает нужным) управлять своим эмоциональным состоянием, не понимает и не анализирует эмоции в коммуникациях. Не проявляет открытость в межличностных отношениях. Не владеет навыками убеждения, либо излишне «давит» на партнера, либо занимает соглашательскую позицию. Полагает, что правильные мнения в доказательстве не нуждаются. Не обладает выразительностью речи, испытывает дискомфорт при необходимости вступать в коммуникации, избегает публичных выступлений.', 1, 129),
(469, 'Всегда отличается нестандартным мышлением. Быстро и эффективно находит новые способы решения стоящих задач. С интересом и готовностью участвует в новых проектах. Генерирует новые идеи. Разрабатывает, внедряет, усовершенствует инновационные продукты, методы, подходы, процессы и т.п.', 4, 130),
(470, 'В решении рабочих задач может применять новые, наиболее оптимальные способы решения, стремится разнообразить подходы к постоянным, рутинным процессам.', 3, 130),
(471, 'Подход к решению задач достаточно стандартный, редко использует новые  способы и инструменты в работе.', 2, 130),
(472, 'Не способен ясно и точно выражать свои мысли. Не слушает других и не стремится к пониманию другой стороной общения. Допускает большое количество ошибок в письменной и/или устной речи. В речи могут присутствовать  слова-паразиты, усложняющие восприятие речи. Не способен (или не считает нужным) управлять своим эмоциональным состоянием, не понимает и не анализирует эмоции в коммуникациях. Не проявляет открытость в межличностных отношениях. Не владеет навыками убеждения, либо излишне «давит» на партнера, либо занимает соглашательскую позицию. Полагает, что правильные мнения в доказательстве не нуждаются. Не обладает выразительностью речи, испытывает дискомфорт при необходимости вступать в коммуникации, избегает публичных выступлений Скептически относится к нововведениям, мышление в основном шаблонное, применяет только проверенные способы решения задач.', 1, 130),
(473, 'Испытывает затруднения при необходимости проявить активность/разработать и внедрить нововведение: Демонстрирует, скорее, реактивное поведение: «Будет задача, будем ее решать, а пока работаем как работали».', 1, 131),
(474, 'Постоянно проявляет стремление к улучшению любых востребованных областей своей деятельности. При чем, делает это самостоятельно, без давления извне или просьб. Всегда идет «на шаг впереди», предлагает новые, конструктивные идеи, способные вывести свое подразделение и компанию  в целом далеко вперед. Инициативен в высокой степени.', 4, 131),
(475, 'Всегда находится в активной позиции по отношению к решению всех задач, участия в проектах. Предлагает идеи. С готовностью и одобрением относится к нововведениям. Периодически выходит за рамки своих обязанностей, если видит возможности, которые могут быть полезны ему и команде.', 3, 131),
(476, 'Не достаточно активен. Редко проявляет инициативу в рабочих вопросах, чаще готов выполнять уже готовые решения. Может проявлять  желание улучшать существующие процессы,  но ограничивается рамками своей деятельности, не особо интересуясь положением дел смежных подразделений, компании в целом.', 2, 131),
(477, 'Профессиональные знания поверхностные. Не имеет достаточных навыков работы по профессии. Допускает значительные сбои в рабочих процессах. Не ориентирован на получение знаний и применение их на практике.', 1, 132),
(478, 'Профессиональные знания достаточно общие. Отсутствует глубокое представление обо всех нюансах работы по профессии. Допускает сбои в стандартных рабочих процессах, влияющие на  качество, количество и (или) сроки предоставления  результатов труда. Не видит необходимости повышать свой профессиональный уровень ни теоритически, ни практически. Однако,  может соглашаться на обучение по требованию руководства.', 2, 132),
(479, 'Хорошие профессиональные знания. Обладает опытом, сформировавшим необходимые и достаточные умения и навыки по профессии. Достигает целей в заданные сроки, сохраняя достойное качество работы. В нестандартных и сложных рабочих ситуациях возможно некоторое снижение эффективности. Достаточное понимание всех направлений деятельности, отраслевой специфики. Повышает свою квалификацию в необходимых для компании требованиях.', 3, 132),
(480, 'Обладает уникальным опытом и знаниями, позволяющими легко разбираться в комплексных профессиональных вопросах. Обладает свойством систематически, эффективно и надежно выполнять сложную деятельность в самых разнообразных условиях. Разбирается в нестандартных рабочих ситуациях. Понимает все тонкости и нюансы профессии. Ценен для компании как носитель уникальных технологий и бизнес-процессов. Эксперт, «Мастер своего дела». Постоянно совершенствует свой профессиональный уровень, стремится подняться на высшую ступеньку мастерства в своем роде занятий.', 4, 132),
(481, 'Умеет и проявляет инициативу в обучении и развитии сотрудников компании. Не ждет, пока его попросят разъяснить те или иные рабочие вопросы, в которых он разбирается лучше других. Доходчиво объясняет необходимые проблемные моменты. Затрачивает усилия по обучению только на тех сотрудников, в которых видит перспективу или которые проявляют большой интерес к его знаниям и опыту. В моменты затруднений у сотрудника дает обратную связь, которая  стимулирует его развитие. Умеет мотивировать сотрудников на повышение их профессионального уровня. Иногда, может выйти на более высокий уровень и обсудить  с сотрудниками значимость выполняемой работы, необходимость повышения мастерства в рамках не только своей должности, но и подразделения и компании в целом.', 3, 133),
(482, 'Обладает отличным умением и большим желанием передавать накопленные знания и опыт своим коллегам. Систематически консультирует, обучает, развивает сотрудников. Сам является примером высокого профессионализма, авторитетен в глазах коллег. Знает все тонкости и нюансы работы, может продемонстрировать или объяснить эффективные способы их выполнения. Дает конкретную обратную связь другим относительно их сильных и слабых сторон, формируя в них компетентность и ответственность. В обучении проявляет позитивный эмоциональный настрой, поддерживает «учеников». Умеет доносить до других цели организации, следит за тем, чтобы люди в его подразделении  понимали связь своей работы с общими задачами всей компании. Понимает необходимость развития кадрового резерва на предприятии.', 4, 133),
(483, 'Не отказывает, но и не стремится проявлять инициативу в обучении других сотрудников. Откликается только на конкретные просьбы о помощи, если они не сильно отвлекают его от своей деятельности. Не всегда доходчиво и понятно может объяснить, научить, показать на собственном примере решение требуемой проблемы. Не дает обратную связь о продвижении сотрудника в рабочем процессе.', 2, 133),
(484, 'Не способен обучать и развивать сотрудников. Не имеет желания прикладывать усилия для повышения мастерства других людей. Скорее откажет в просьбе о помощи в разрешении чьей-нибудь рабочей проблемы.', 1, 133),
(485, 'Не достаточно хорошо понимает значимость удовлетворения клиентов – как основного приоритета в работе компании. Не знаком со своими клиентами так, чтобы понимать все их потребности. Во взаимодействии с клиентами/коллегами чаще отстаивает только свои интересы. Понимает только явные, озвучиваемые потребности, не распознает скрытых потребностей. Не предпринимает необходимых усилий к сглаживанию возникших или предупреждению возможных конфликтных ситуаций. Откликается только на самые серьезные критические обращения, затягивает решения проблем до последнего момента.', 2, 134),
(486, 'Обладает глубокими знаниями и отличным пониманием клиентов, их поведения и потребностей. Умеет смотреть на результаты своей работы  и работы компании глазами клиента (партнера). Принимает на себя личную ответственность за качественное обслуживание клиентов. Выявляет интересы и потребности коллег и клиентов с целью их удовлетворения, помогает им сформулировать и структурировать запрос. Способен устанавливать и поддерживать долгосрочные и эффективные отношения. Всегда открыт для их обращений, проявляет инициативу в решении любых возникающих, даже не по вине компании, проблем. Знает и поздравляет своих основных клиентов с из личными праздниками (Дни рождения и т.п.).', 4, 134),
(487, 'Умеет распознавать потребности клиентов/партнеров/коллег. Во взаимодействии старается соблюдать баланс интересов своих и второй стороны. Настроен на поиск оптимальных для всех решений. Оперативно решет возникающие конфликтные ситуации, принимает меры к предотвращению возможных проблем в будущем. В большинстве случаев понимает и удовлетворяет не только явные, но и скрытые, не озвученные проблемы клиентов. Своевременно поздравляет клиентов с основными государственными, профессиональными праздниками.', 3, 134),
(488, 'Не понимает значимости взаимовыгодного сотрудничества и крепких партнерских отношений с внешними и внутренними  клиентами для стабильной и долгой работы компании. Отсутствует способность выстраивать эффективные отношения с клиентами. При возникновении проблем с клиентами/партнерами/коллегами предпочитает переложить ответственность на другую конфликтующую сторону. Не отдает отчет в том, что любые (даже самые незначительные)  жалобы клиентов могут перерасти в большие проблемы для компании, серьезно сказаться на ее имидже и положении на рынке.', 1, 134),
(489, 'Ценности компании не разделяет. Не отождествляет себя с компанией. Прослеживается негативное отношение к Работодателю. Выстраивает свое поведение в разрез с правилами и нормами, принятыми в компании. Не уверен, что будет работать в компании продолжительный период.', 1, 135),
(490, 'Ценности компании в общем понимает, но к себе не применяет, предпочитая оставаться в стороне. Работает только на осуществление своей функции, не соотнося ее с общим результатом. Некоторые принципы, правила и нормы компании вызывают отторжение. В разговоре о компании может фокусироваться на негативных сторонах, оставляя в стороне положительные моменты. Не готов связывать себя с компанией в долгосрочной перспективе.', 2, 135),
(491, 'Безусловно понимает и принимает компанию. Точно знает и разделяет ценности, цели, правила компании (даже неформальные). Выстраивает свое рабочее поведение в соответствии с ними. Является приверженцем компании. Неравнодушен ко всему, что связано с ней. Находит собственные цели и ценности схожими с целями и ценностями  компании. Связывает свое будущее с компанией. Прикладывает гораздо больше усилий, чем прописано в должностной инструкции. Проявляет преданность своему делу, своей работе. Проявляет желание улучшить компанию. Испытывает чувство гордости за место, в котором работает. Интересы предприятия всегда на первом месте. ', 4, 135),
(492, 'Понимает и принимает ценности и цели компании. При необходимости готов к выполнению сверх необходимого. Принимает активное участие в жизни компании. Проявляет неравнодушное отношение не только к проблемам, касающимся лично себя, но и своего подразделения,  компании. Планирует работать в компании в будущем. Положительно отзывается о компании, о работе и взаимоотношениях в ней.', 3, 135),
(493, 'Обладает очень высокими знаниями и практическими навыками     ', 4, 138),
(494, 'Обладает твердыми знаниями и практическими навыками  ', 3, 138),
(495, 'Знания и практические навыки удовлетворительные ', 2, 138),
(496, 'Знания и практические навыки соответствуют минимальным требованиям', 1, 138),
(497, 'Обладает наиболее высокой устойчивостью и способностями к преодолению', 4, 139),
(498, 'Устойчивость и способности твердые', 3, 139),
(499, 'Устойчивость и способности удовлетворительные ', 2, 139),
(500, 'Обладает низкой устойчивостью (часто теряет самообладание) ', 1, 139),
(501, 'Обладает высоким уровнем организаторских способностей и умений', 4, 140),
(502, 'Уровень организаторских способностей и умений вполне достаточен', 3, 140),
(503, 'Уровень организаторских способностей и умений удовлетворительный', 2, 140),
(504, 'Обладает низким уровнем организаторских способностей и умений', 1, 140),
(505, 'Имеет редкие способности', 4, 141),
(506, 'Успешно справляется с «выращиванием» подчиненных и стимулированием их  деятельности', 3, 141),
(507, 'Умения развиты удовлетворительно ', 2, 141),
(508, 'Обладает слабыми умениями', 1, 141),
(509, 'Всегда проявляет высокую объективность', 4, 142),
(510, 'Стремится быть объективным', 3, 142),
(511, 'Допускает элементы необъективности', 2, 142),
(512, 'Сознательно допускает необъективность    ', 1, 142),
(513, 'Обладает исключительной инициативой и находчивостью', 4, 143),
(514, 'Инициатива и находчивость проявляются достаточно регулярно', 3, 143),
(515, 'Инициатива и находчивость проявляются не всегда', 2, 143),
