(96, 'Стратегическое мышление: понимание того, что нужно делать сегодня, чтобы получить результаты в долгосрочной перспективе.', 1, NULL),
(97, 'Работа с подчиненными: Способность эффективно организовывать работу подчиненных  в рамках основных управленческих компетенций (планирование, обеспечение ресурсами, постановка задач, делегирование, контроль, оценка и обратная связь, мотивация, сплочение коллектива, обучение и развитие)', 1, NULL),
(98, 'Анализ информации и принятие решений: Способность анализировать получаемую информацию, принимать на ее основе самостоятельные решения и нести ответственность за полученные результаты.', 1, NULL),
(99, 'Организация процесса: Способность выстраивать процесс работы в соответствии с поставленными целями в пределах согласованных сроков и с достижением необходимых результатов.', 1, NULL),
(100, 'Коммерческий подход: Способность использовать экономические показатели при принятии решений. Ориентация на повышение экономической эффективности вверенного участка работы. ', 1, NULL),
(101, 'Коммуникабельность: Умение эффективно строить взаимоотношения с людьми, способность  выразить и донести свою точку зрения с помощью всех возможных способов коммуникации (устных и письменных) в ситуациях делового общения и переговоров.', 1, NULL),
(102, 'Творчество: Применение нестандартных решений и подходов в ежедневной работе.', 1, NULL),
(103, 'Инициативность: Высокая активность, отношение к своей работе, как к сфере приложения максимально возможных усилий с целью улучшения существующего положения дел.', 1, NULL),
(104, 'Профессионализм: Степень развития знаний, умений и навыков, необходимых для выполнения работы надлежащего качества и в установленные сроки.', 1, NULL),
(105, 'Наставничество: Способность развивать людей в рамках общего рабочего процесса для достижения ими более высоких уровней мастерства. ', 1, NULL),
(106, 'Клиенто-ориентированность: Чуткое понимание и удовлетворение потребности клиентов (в т.ч. внутренних – смежные подразделения, коллеги).', 1, NULL),
(107, 'Лояльность к Компании: Понимание и принятие компании. Разделение ее ценностей, правил и норм.', 1, NULL),
(108, 'Перечислите достигнутые успехи и приобретенные новые качества сотрудника за последний год работы (в случае если сотрудник работает меньше указанного периода – с момента работы в вашем подразделении).', 0, NULL),
(109, 'В чем для Вас заключается особая ценность данного сотрудника? ', 0, NULL),
