(111, 'Ваши рекомендации для профессионального роста данного сотрудника?  ', 0, NULL),
(112, 'Ваши рекомендации по дальнейшему карьерному развитию данного сотрудника (выдвижение на вышестоящую должность, включение в кадровый резерв и т.д.)  ', 0, NULL),
(113, 'Укажите, состоит ли сотрудник в Вашем кадровом резерве?', 0, NULL),
(114, 'Перечислите Ваши наиболее значимые результаты и достижения за последний год работы в компании (в случае если Вы работаете меньше указанного периода – с момента работы в компании).', 0, NULL),
(115, 'Проходили ли Вы какое-либо дополнительное обучение (курсы, семинары и т.д.) за последний год работы в компании (самостоятельно, по направлению компании)?  Укажите название обучающих программ, по которым Вы обучились. ', 0, NULL),
(116, 'Как используете в работе полученные знания, умения и навыки (после прохождения дополнительного обучения)? ', 0, NULL),
(117, 'Сформулируйте цели на ближайший год, которые Вы планируете достичь для повышения своей личной эффективности (что Вы планируете сделать, чтобы стать более эффективным? Как собираетесь развиваться профессионально?)', 0, NULL),
(118, 'В каких ресурсах и в какой поддержке Вы нуждаетесь для повышения вашей личной эффективности и выполнения поставленных целей на год? ', 0, NULL),
(119, 'Какие изменения, по Вашему мнению, могут содействовать повышению эффективности работы Вашего подразделения и всей компании?', 0, NULL),
(120, 'Оцените Вашу мобильность: готовы ли вы к переезду в рамках развития внутри компании? Если да, то какие регионы нашей компании вы рассматриваете?', 0, NULL),
