(151, 'Личная дисциплина, исполнительность, надежность в деловых отношениях', 1, NULL),
(152, '1. Строить свою карьеру в пределах конкретной научной или технической сферы.', 1, NULL),
(153, '2. Осуществлять наблюдение и контроль над людьми, влиять на них на всех уровнях.', 1, NULL),
(154, '3. Иметь возможность делать все по-своему и не быть стесненным правилами какой-либо организации.', 1, NULL),
(155, '4. Иметь постоянное место работы с гарантированным окладом и социальной защищенностью.', 1, NULL),
(156, '5. Употреблять свое умение общаться на пользу людям, помогать другим.', 1, NULL),
(157, '6. Работать над проблемами, которые представляются почти неразрешимыми.', 1, NULL),
(158, '7. Вести такой образ жизни, чтобы интересы семьи и карьеры взаимно уравновешивали друг друга.', 1, NULL),
(159, '8. Создать и построить нечто, что будет всецело моим произведением или идеей.', 1, NULL),
(160, '9. Продолжать работу по своей специальности, чем получить более высокую должность, не связанную с моей специальностью.', 1, NULL),
(161, '10. Быть первым руководителем в организации.', 1, NULL),
(162, '11. Иметь работу, не связанную с режимом или другими организационными ограничениями.', 1, NULL),
(163, '12. Работать в организации, которая обеспечит мне стабильность на длительный период времени.', 1, NULL),
(164, '13. Употребить свои умения и способности на то, чтобы сделать мир лучше.', 1, NULL),
(165, '14. Соревноваться с другими и побеждать.', 1, NULL),
(166, '15. Строить карьеру, которая позволит мне не изменять своему образу жизни.', 1, NULL),
(167, '16. Создать новое коммерческое предприятие.', 1, NULL),
(168, '17. Посвятить всю жизнь избранной профессии.', 1, NULL),
(169, '18. Занять высокую руководящую должность.', 1, NULL),
(170, '19. Иметь работу, которая представляет максимум свободы и автономии в выборе характера занятий, времени выполнения и т.д.', 1, NULL),
(171, '20. Оставаться на одном месте жительства, чем переехать в связи с повышением.', 1, NULL),
(172, '21. Иметь возможность использовать свои умения и таланты для служения важной цели.', 1, NULL),
(173, '22. Единственная действительная цель моей карьеры – находить и решать трудные проблемы, независимо от того, в какой области они возникли .', 1, NULL),
(174, '23. Я всегда стремлюсь уделять одинаковое внимание моей семье и моей карьере.', 1, NULL),
(175, '24. Я всегда нахожусь в поиске идей, которые дадут мне возможность начать и построить свое собственное дело.', 1, NULL),
(176, '25. Я соглашусь на руководящую должность только в том случае, если она находится в сфере моей профессиональной компетенции.', 1, NULL),
(177, '26. Я хотел бы достичь такого положения в организации, которое давало бы возможность наблюдать за работой других и интегрировать их деятельность.', 1, NULL),
(178, '27. В моей профессиональной деятельности я более всего заботился о своей свободе и автономии.', 1, NULL),
(179, '28. Для меня важнее остаться на нынешнем месте жительства, чем получить повышение или новую работу в другой деятельности.', 1, NULL),
(180, '29. Я всегда искал работу, на которой мог бы приносить пользу другим.', 1, NULL),
(181, '30. Соревнование и выигрыш – это наиболее важные и волнующие стороны моей карьеры.', 1, NULL),
(182, '31. Карьера имеет смысл только в том случае, если она позволяет вести жизнь, которая мне нравится.', 1, NULL),
(183, '32. Предпринимательская деятельность составляет центральную часть моей карьеры.', 1, NULL),
(184, '33. Я бы скорее ушел из организации, чем стал заниматься работой, не связанной с моей профессией.', 1, NULL),
(185, '34. Я буду считать, что достиг успеха в карьере только тогда, когда стану руководителем высокого уровня в солидной организации.', 1, NULL),
(186, '35. Я не хочу, чтобы меня стесняла какая-нибудь организация или мир бизнеса.', 1, NULL),
(187, '36. Я бы предпочел работать в организации, которая обеспечивает длительный контракт.', 1, NULL),
(188, '37. Я бы хотел посвятить свою карьеру достижению важной и полезной цели.', 1, NULL),
(189, '38. Я чувствую себя преуспевающим только тогда, когда я постоянно вовлечен в решение трудных проблем или в ситуацию соревнования.', 1, NULL),
(190, '39. Выбрать и поддерживать определенный образ жизни важнее, чем добиваться успеха в карьере.', 1, NULL),
(191, '40. Я всегда хотел основать и построить свой собственный бизнес.', 1, NULL),
(192, '41. Я предпочитаю работу, которая не связана с командировками.', 1, NULL),
