(2476, 378, 114, NULL, '   1)    Инвестиционная программа – систематизация учета и взаимодействия. 2) Оцифровка и запуск заявочной кампании на РП     (предоставление, согласование и исполнение заявок на все запасные части, автошины, горюче-смазочные материалы и другие товарно-материальные ценности в электронном виде с помощью программы «Б24») 2.1) подготовка технического задания и запуск бизнеспроцесса полного цикла закупки ТМЦ. 3) Разработка методологии и подсчет показателей мотивации ОМТС РП , по следующим показателям: 1. Соблюдение бюджета закупок 2. Соблюдение лимита складских остатков 3. Уменьшение доли поставщиков с УСН 4. Увеличение отсрочки платежа по договорам поставки 5. Увеличение скидки по договорам поставки 6. Контроль сроков выполнения заявок по инвест программе 7. Контроль сроков выполнения заявок. 8. Анализ цен/аналитика выбора поставщика/подтверждение скидки 9. Контроль сроков поступлений ТМЦ в УАТ-КОРП 4)  Контроль кредиторской задолженности перед поставщиками ОМТС в разрезе РП - в динамике, выявление критической задолженности. 5.1) Разработка технического задания и реализация проекта учета заявок и статей бюджета ТМЦ в 1С УАТ + КОРП - первая очередь 5.2) Разработка технического задания и реализация проекта автоматического формирования заявки на оплату в 1С КОРП - вторая очередь. 5.3) Разработка технического задания и реализация проекта автоматического формирования БДДС в 1С КОРП - третья очередь. 6) Централизованное формулирование и систематизация проектов развития СС. Внедрение реестра проектов и задач. 7) Централизация поставки ТМЦ от призводителей. 8.) Контроль динамики расхода топлива ТМЦ и цен на них, по статьям бюджета в разрезе РП. Разработка механизма своевременного реагирования и влияния на изменение цен.	 Перспективно: учет ТМЦ оборотного фонда и вторичной переработки.'),
