(3176, 367, 114, NULL, '1.	Повышение производительности работы АИС ПЗ: - для диспетчеров разработан функционал передачи заявок логисту РП; - проставление реальных причин (внутренние причины) отказа от принятия заявки к исполнению; - при проставлении причины отказа ТС на ремонте проставление гос. рег. знака ТС стоящего на ремонте и Ф.И.О. сотрудника, предоставившего информацию. 2.	Способность работы специалистов (зам. начальника ЦДС, старшие диспетчера) во время отсутствия руководителя (командировка, отпуск и т.д.).'),
