(3194, 367, 117, NULL, '1.	100 % централизация ЦДС: - перевод операторских функций в ЦДС с ДВРП и СКРП; - ужесточение контроля над расчётом путевых листов сотрудниками РП путём запрета расчёта ПЛ всем кроме операторов ЦДС. 2.	Оптимизировать численность персонала ЦДС за счёт объединения функций диспетчера и оператора. 3.	Передать функционал по СВП «Платон» по ТС ООО «СКА» и ОАО «РЖД» в РП с января 2020 г.: - регистрация ТС; - сдача, получение и замена бортовых устройств; - заявки на оплату; - заключение агентских договоров; - ежемесячная подготовка отчётов агента в установленные агентским договором сроки. '),
(3195, 367, 118, NULL, 'Прохождение курса «Эффективный руководитель». Обучение запланировано на 4-й квартал 2019 г.'),
