(3197, 367, 119, NULL, '1.	Повышение мотивации персонала в связи с увеличением производительности. 2.	Доработка программного обеспечения ПО УАТ и автоматизация производственных процессов. 3.	Полноценное внедрение мобильного приложения (Проект СКА Водитель).'),
(3198, 367, 120, NULL, 'Готова к краткосрочным (2 недели) командировкам в РП Общества.'),
