(5446, 448, 114, NULL, '1)	Положительная динамика в работе по приему (раскредитации) и автовывозу крупнотоннажных контейнеров с терминалов г. Хабаровска. Расширена клиентская база с транспортно-экспедиторскими компаниями г. Хабаровска, г. Комсомольска-на-Амуре, а также заключены договоры с компаниями г. Москвы, г. Санкт-Петербурга, г. Иркутска. Услуги оказываем собственным транспортном в количестве 3-ех единиц, периодически привлекаем подрядчиков. Транспортные средства постоянно загружены. Максимальная выручка по направлению составила: июнь 2019 г. – 1 254 000 руб. с НДС, июль 2019 г. – 1 591 000,00 руб. с НДС.  Проведена работа по увеличению рентабельности за счет снижения затратной части (топливо, командировочные). Разработана мотивирующая система оплаты труда водителям контейнеровозов, зависящая от вывезенных объемов. 2)	Заключен договор с ООО «Полиметалл ДВ» по перевозке флотационного концентрата, направление Албазино –  ООО «АГМК» (г. Амурск), расстояние (плечо) 431 км. Выручка с декабря 2018 г. по март 2019 г. - 4 162 217,00 руб. с НДС. Рентабельность проекта 24.9%. 3)	Улучшена экономика проекта «Транснефть Надзор»: проведена оптимизация затрат и переговоры по увеличению тарифа, как следствие, удалось выйти в прибыль по итогам работы мая и июня 2019 г.'),
