(5474, 448, 117, NULL, '1.	Достигнуть положительной рентабельности по сортировке и погрузке леса за счет получения от РФП максимальных объемов. Увеличить выручку по перевозке леса за счет расширения клиентской базы и автопарка. 2.	Продолжить развитие проекта «Контейнерные перевозки»: увеличить выручку и рентабельность перевозок. 3.	Запустить проект «Контейнерный терминал в г. Хабаровске»: организации сервиса для грузоотправителей, грузополучателей и транспортно-экспедиторских компаний-собственников контейнерного парка по хранению и переработке порожних (возможно, груженых) контейнеров, в т.ч. рефрижераторных контейнеров. Данный проект, имея небольшую предварительную расчетную рентабельность, позволит оказывать комплекс работ, как следствие, привлечь дополнительные объемы выручки, клиентов и сделать более узнаваемым бренд «СКА». 4.	Повысить эффективность использования собственных коммерческих ТС. Начать использовать субподрядный транспорт по коммерческим договорам.  5.	Подготовить инвестиционную программу на 2020 г. по приобретению ТС для новых коммерческих проектов.'),
