(5775, 654, 114, NULL, 'По КРУ: Выстроена работа КРУ по направлениям. Предложена и принята в работу методика проверок. на основании проверок запущены бизнес-процессы, например,  по качественному оформлению ремонтных листов, по эффективности использования ТС, по актуализации внутренних регламентов. Проведены комплексные проверки ВСРП, СЗРП, ДВРП. На основании проверок разработаны планы мероприятий (изменение бизнес-процессов). По финансовой службе: получение ВКЛ, разработка финансовой стратегии на ближайшую перспективу. '),
