(5778, 654, 117, NULL, 'Профессионально управлять бизнес-процессами предприятия. '),
(5779, 654, 118, NULL, 'Профессионалов своего дела во внутреннем аудите по различным направлениям (техническое, эксплуатационное, IT), которые в команде предлагают новые (возможно, нестандартные) подходы и идеи для повышения эффективности бизнеса.'),
(5780, 654, 119, NULL, 'Развитие сотрудников подразделения (участие в тематических семинарах, выставках, обмен опытом с другими компаниями) для того, чтобы они были не \"узкими\" специалистами, а владели знаниями по разным направлениям. Для компании - более тесное взаимодействие между АУ и РП по выявленным недостаткам для модифицирования бизнес-процессов. '),
