(5834, 653, 114, NULL, 'Системное администрирование 1.	Внедрение системы переноса активных рабочих нагрузок  (на базе Veeam) 2.	Внедрение Docker для декларативного описания инфраструктуры 3.	Распределение нагрузок ДБ по серверам для снижения пиковых нагрузок 4.	Организация ЦДС (оптимизация каналов + 5 этаж) 5.	Работы по реорганизации оборудования и плановой замене накопителей  Разработка ПО  1.	Разработка и запуск «Консолидированной БД»  (УАТ-КОРП(упр)-ЗУП). 2.	Внедрение Бирикс24. Разработка бизнес-процессов. Перенос документооборота компании. 3.	В рамках внедрения версионирования всех разрабатываемых продуктов осуществили внедрение GIT lab и перевод на его использование разрабатываемых проектов 4.	Разработка и запуск Мобильного приложения 2.0 5.	Разработка и внедрение модуля взаимодействия АСАТ – АСИПЗ – УАТ 6.	Внедрение Docker в рамках концепции непрерывного кода DevOps 7.	Оптимизация цепочки действия по документальному отражению ремонта ТС. 8.	Разработка ПО для СУП тест 360 градусов 9.	Разработка ПО для функционирования СТЛ 10.	Разработка и запуск универсальной системы электронных заявок под работу с ВРК и др. контрагентами. 11.	Перенос отчетности wialon в УАТ 12.	Внедрение опер смен в КОРП (фин. блок)'),
(5835, 653, 115, NULL, '2018 – Использование и построение облачной ИТ инфраструктуры для бизнеса. 2018 – Использование AGILE в проектировании, разработке ПО и развертывании инфраструктуры.  2019 – Технология непрерывной поставки кода DevOps.'),
(5836, 653, 116, NULL, 'Переговоры с внутренним заказчиком и внешними контрагентами Оптимизация рабочего процесса по разработке Фильтрация задач Подход к версионированию разрабатываемых решений'),
(5837, 653, 117, NULL, '1.	Внедрение методов DevOps в рамках совершенствования управления разработкой ПО и создания/поддержки инфраструктуры 2.	Разработка подходов по оптимизации инфраструктуры хранения данных (ускорение разработки, оценка качества внедрения и упрощение работы пользователей) 3.	Аналитика BIG DATA 4.	Развитие концепции непрерывного кода DevOps 5.	Развитие декларативного описания инфраструктуры'),
