(5966, 667, 117, NULL, 'Цель: Приложить все усилия для развития коммерческого отдела и увеличения стороннего зарабатывания.'),
(5967, 667, 118, NULL, 'В ресурсах не нуждаюсь, для повышения эффективности требуется своевременная реакция других подразделений.'),
(5968, 665, 119, NULL, '1. комплексный переход на сдельную систему оплаты труда (включая изменение в учете выполненных заданий), укомплектованность штата для перехода на 12-часовую или круглосуточную )по отдельным видам ремонта) работу'),
(5969, 667, 119, NULL, 'Точное разграничение обязанностей внутри отдела, а так же между подразделениями.'),
(5970, 667, 120, NULL, 'Не готов.'),
