(6252, 684, 117, NULL, 'Подробно изучить и проанализировать опыт работы коммерческих ремонтных предприятий, продолжить изучение экономического анализа производственной деятельности, глубже изучить производственный процессы вновь организованных и организуемых услуг.'),
