(6254, 684, 119, NULL, 'В случае сохранения контракта с ВСЖД, увеличение и обновление парка ТС Восточно-Сибирского региона. Окончание формирования АУ ВСРП. В масштабе компании: необходима более внятная финансовая политика; завершение формирования системы мотивации и оценки труда ИТР и руководителей. и мотивации '),
