(306, 'Юрист (корпоративный юрист)', '', '', '', '7fe26de8-d5fd-11e5-94e1-000c29d626e6'),
(307, 'Якоря карьеры', 'Пожалуйста, ответьте на вопросы теста. С 1-21. Насколько важным для Вас является каждое из следующих утверждений?  С 22 - 41. Насколько Вы согласны с каждым из следующих утверждений? Внимательно прочтите утверждения, приведенные ниже. Используя 10-балльную шкалу  оценивания, определите, насколько каждое из предложенных утверждений важно для вас. Если  утверждение совершенно не важно, то в бланке для ответов соответственно порядковому номеру  утверждения выберите цифру 1, если исключительно важно, то 10. Чем более важным для вас  является утверждение, тем большая цифра выбирается.', 'Здравствуйте, коллеги!', 'Здравствуйте! В рамках процедуры оценки управленческих компетенций руководителей ЦДС . Вам необходимо пройти тест ', '5a4cea19-d5fd-11e5-94e1-000c29d626e6'),
(327, 'Оценка 360 для руководителей ', 'Вам необходимо провести оценку по каждой компетенции и ответить, какому описанию больше всего соответствует уровень развития данной компетенции у указанного сотрудника. Обращаем Ваше внимание, что компетенции расположены хаотично, а не в хронологии в соответствии весу компетенции.', 'Здравствуй, Уважаемый коллега! ', 'Здравствуйте! Мы запускаем процедуру оценки управленческих компетенций по методу 360 градусов. Оценка проводится по схеме Руководитель-Коллега-Подчиненный-Самооценка. Если Вам пришло это письмо, значит есть подчиненный/руководитель/коллега, в оценке которого Вы участвуете. Необходимо заполнить все предлагаемые вам анкеты. Заполняете в таком порядке, в котором вам удобно', NULL),
(328, 'Опросник \"Оценка руководителя\"', 'Пожалуйста, дайте ответ на открытые вопросы, которые помогут нам раскрыть оцениваемого сотрудника. Помните, что оставленные без ответов вопросы будут всё-равно заданы непосредственно при проведении оценки.', 'Уважаемый руководитель! Просим высказать Ваше мнение о своём подчинённом.', ' Здравствуйте!   Уважаемые руководители, в рамках подготовки к ежегодной оценке сотрудников, Вам необходимо заполнить бланк \"Оценка руководителя\"', NULL),
(329, 'Индивидуальный план развития', 'Пожалуйста, дайте ответ на открытые вопросы, которые помогут нам раскрыть Вас. Помните, что оставленные без ответов вопросы будут всё-равно заданы непосредственно при проведении оценки.', 'Уважаемый сотрудник! Скоро Вам предстоит пройти ежегодную оценку. Ответы на вопросы, указанные далее, помогут нам провести её с учётом Ваших интересов.', 'Здравствуйте! Уважаемые коллеги, в рамках подготовки к ежегодной оценке специалистов и руководителей, Вам необходимо заполнить бланк ', NULL),
(330, 'Оценка 360 для специалистов ', 'Вам необходимо провести оценку по каждой компетенции и ответить, какому описанию больше всего соответствует уровень развития данной компетенции у указанного сотрудника. Обращаем Ваше внимание, что компетенции расположены хаотично, а не в хронологии в соответствии весу компетенции.', 'Здравствуйте, уважаемый коллега!', 'Здравствуйте! Мы запускаем процедуру оценки управленческих компетенций по методу 360 градусов. Оценка проводится по схеме Руководитель-Коллега-Подчиненный-Самооценка. Если Вам пришло это письмо, значит есть подчиненный/руководитель/коллега, в оценке которого Вы участвуете. Необходимо заполнить все предлагаемые вам анкеты. Заполняете в таком порядке, в котором вам удобно.', NULL),
(339, 'ТЕСТ Проверка создания теста', 'Ломай круши, не дай работать', 'Погнали Тестировать', 'Да здравствует ущербный Битрикс24', NULL),
(371, 'Тест ЦДС', '', '', '', NULL),
(511, 'Оценка 360 для руководителей ЦДС', 'Предлагаем Вам принять участие в оценке ваших руководителей. Анкетирование  будет проводиться анонимно. Этот опрос поможет вашему коллеге, руководителю (оцениваемому) лучше понять свои сильные и слабые стороны, увидеть потенциал дальнейшего роста и развития. Никакие меры поощрения или наказания по результатам исследования приниматься не будут. Мы гарантируем анонимность и конфиденциальность. В связи с этим просим вас давать максимально правдивые, откровенные и обдуманные ответы. Если вы по характеру взаимодействия с этим человеком не видите проявления некоторых аспектов поведения и не можете судить о том, как он проявляет себя в описываемых ситуациях, пожалуйста, выбирайте тот ответ, который по Вашему прогнозу мог бы быть, исходя из  опыта совместной работы и наблюдения со стороны. Опрос занимает в среднем не более 15 минут. Рекомендуем вам дать ответы на вопросы в анкете сразу же от начала до конца, не отвлекаясь. Так вы сможете сэкономить время и повысить достоверность результатов. Вы можете оказать существенную помощь коллегам в понимании их сильных и слабых сторон и в улучшении обстановки в коллективе. Спасибо вам за искренние ответы! ', 'Здравствуйте, коллеги!', 'Здравствуйте! Мы запускаем процедуру оценки управленческих компетенций руководителей ЦДС по методу 360 градусов. Оценка проводится по схеме Руководитель-Коллега-Подчиненный-Самооценка. Если Вам пришло это письмо, значит есть подчиненный/руководитель/коллега, в оценке которого Вы участвуете. Необходимо заполнить все предлагаемые вам анкеты. Заполняете в таком порядке, в котором вам удобно', NULL);
